css:
@-moz-document domain("spacex.com.pl") {
html,body{
    background: #181c1f;
}
:root{
    scrollbar-color: #fff #181c1f;
}
/*HEADER*/
.navigation{
    background: #181c1f;
    box-shadow: none;
}
.navigation .navigation__link{
    color: #46598D;
}
.navigation .navigation__link--live{
    color: #b70500;
}
/*SEARCH*/
.search_widget::before{
    border-bottom: 36px solid transparent;
    border-right: 34px solid #00548d;
    left: -44px
}
.search_widget .search_widget__input{
    background: #181c1f;
    border: 1px solid #00548d;
}
.search_form{
    background: #181c1f;
    box-shadow: none;
}
.search_form .search_form__input{
    background: #181c1f;
    border: 1px solid #00548d;
    color: #00548d;
}
.archive .archive__empty_search{
    color: #fff;
}
.pagination .pagination__element{
    background: #181c1f;
    border: 1px solid #00548d;
}
.pagination .pagination__element--active{
    background: #a7a9ac;
}
.pagination .pagination__element--disabled:hover{
    background: #181c1f;
}
.pagination .pagination__link{
    color: #00548d;
}
/*SEARCH*/
/*HEADER*/
/*STRONA-GŁÓWNA*/
.article_box,.page,.page .page__details{
    background: #181c1f;
    box-shadow: none;
}
.page_title .page_title__link,.tags_line .tags_line__link,.pagination .pagination__switch,.widget .widget__header,.widget .widget__header_link,.widget_trailer .widget_trailer__name{
    color: #46598D;
}
.page .page__content.page__content--excerpt,.mission_table .mission_table__label,.mission_table .mission_table__value,.widget_popular .widget_popular__article,.fa-tags{
    color: #fff;
}
.tags_line .tags_line__link:hover{
    background: #46598D;
    color: #181c1f;
}
.widget{
    background: #181c1f;
    box-shadow: none;
    border: 1px solid #00548d;
}
/*STRONA-GŁÓWNA*/
/*ARTYKUŁ*/
.page .page__title_link,.author_box .author_box__name{
    color: #46598D;
}
.page .page__content,.author_box .author_box__summary,.page .page__content figure.thumb figcaption{
    color: #fff;
}
.author_box .author_box__inner{
    background: #181c1f;
    border: 1px solid #181c1f;
}
.author_box .author_box__inner:hover{
    border: 1px solid #00548d;
    background: #181c1f;
}
.comments{
    background: #181c1f;
    box-shadow: none;
}
.navigation .navigation__link--active{
    background: #181c1f;
    border: 1px solid #46598D;
}
.navigation .navigation__element::after{
    border-color: transparent transparent #46598D #46598D;
}
.page .page__content figure.thumb{
    background: #181c1f;
}
/*ARTYKUŁ*/
/*PODSTRONY*/
/*LISTA-STARTÓW*/
.mission_row{
    background: #181c1f;
    box-shadow: none;
    border: 1px solid #00548d;
}
.mission_row .mission_row__column{
    color: #46598D;
}
.mission_row.mission_row--header .mission_row__column{
    height: 20px;
    color: #fff;
}
.archive .archive__title,.archive .archive__button{
    color: #00548d;
}
/*LISTA-STARTÓW*/
/*KALENDARZE*/
.page .page__content h1{
    color: #46598D;
}
/*KALENDARZE*/
/*OGLADAJ-NA-ŻYWO*/
.page .page__content h2{
    color: #00548d;
}
/*OGLADAJ-NA-ŻYWO*/
/*PODSTRONY*/
/*FOOTER*/
.footer .footer__disclaimer_title{
    color: #00548d;
}
.footer .footer__disclaimer p,.footer .footer__copyrights{
    color: #fff;
}
.footer .footer__copyrights:before{
    content: "Ciemny motyw by Maciejozaman";
    color: #00548d;
}
/*FOOTER*/
}
